import UploadPDF from "./pages/UploadPDF";
import Home from "./pages/Home";
function App() {
  return (
    <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/upload" element={<Upload />} />
                <Route path="/chat" element={<Chat />} />
            </Routes>
    </Router>
  );
}

export default App;
